INSERT INTO `email_templates` VALUES (1,'Registration Mobile OTP','registration_mobile_otp','',2,'OTP for completing Registration at Nyayaportal.in is: <#MOBILE_OTP>. Do not share it with anyone.','<#MOBILE_OTP>'),(2,'Registration','registration_template','',1,'<p>Dear <#USER_NAME>,</p>\r\n\r\n<p><strong>We are pleased to welcome you at www.nyayaportal.in.</strong></p>\r\n\r\n<p>Your email OTP is <#EMAIL_OTP></p>\r\n\r\n<p>Your email : <#USER_EMAIL></p>\r\n\r\n<p>Your Password : <#USER_PASSWORD></p>\r\n\r\n<p>Thank you,</p>\r\n\r\n<p>Team Nyaya Portal</p>\r\n','<#USER_NAME>,<#EMAIL_OTP>,<#USER_EMAIL>,<#USER_PASSWORD>'),(3,'OTP while mapping between AP and (Professionals/Deed Writers)','otp_while_mapping_from_ap','',1,'Dear <#USER_NAME>,<br/> For local assistance, better services and convenience at Nyaya portal, you are requested to complete your association with <#AP_NAME> scale-1 authorized promoter, <b>your OTP is <#MOBILE_OTP></b>. Please share this only with the authorized promoter you wish to be associated.<br/><br/>Thank you,<br/>Team Nyaya Portal','<#USER_NAME>,<#AP_NAME>,<#MOBILE_OTP>'),(4,'Freeze Deal','freeze_deal','',2,'Dear Customer,%0aOTP for freezing a stamp number <#STAMP_NUMBER>for Nyaya Card through your <#PROFESSION_NAME> <#PROFESSIONAL_NAME> is <#MOBILE_OTP>.%0a%0aThank you,%0aTeam Nyaya Portal','<#STAMP_NUMBER>,<#PROFESSION_NAME>,<#PROFESSIONAL_NAME>,<#MOBILE_OTP>'),(5,'Nyaya Card created through online payment for parties','nc_online_payment_mail_to_party','',1,'<p>Thank you for purchasing Nyaya Card <#PRODUCT_NUMBER> between the parties names <#PARTIES_NAME>, for invoice value <#PRODUCT_NUMBER>.</p>\r\n\r\n<p>For any further assistance please write to us at <a href=\"support@nyayaportal.in\">support@nyayaportal.in</a></p>\r\n\r\n<p>Thank you,</p>\r\n\r\n<p>Team Nyaya Portal</p>\r\n','<#PRODUCT_NUMBER>,<#PARTIES_NAME>,<#PRODUCT_NUMBER>'),(6,'Nyaya Card created through online payment for ca','nc_online_payment_mail_to_ca','',1,'<p>Dear <#USER_NAME></p>\r\n\r\n<p>Thank you for promoting Arbitration. Nyaya Card <#PRODUCT_NUMBER> has been created for your client <#PARTIES_NAME> The incentive Rs. <#INCENTIVE_AMOUNT> has been credited to your bank account no. xxxxxxxx<#LAST_4_DIGITS_OF_ACCOUNT_NUMBER></p>\r\n\r\n<p>Thank you,</p>\r\n\r\n<p>Team Nyaya Portal</p>\r\n','<#USER_NAME>,<#PRODUCT_NUMBER,<#PARTIES_NAME>,<#INCENTIVE_AMOUNT>,<#LAST_4_DIGITS_OF_ACCOUNT_NUMBER>'),(7,'Nyaya Card created through online payment for stamp vendor','nc_online_payment_mail_to_stamp_vendor','',1,'<p>Dear <#USER_NAME></p>\r\n\r\n<p>Thank you for promoting Arbitration. Nyaya Card for stamp <#STAMP_NUMBER> has been created. The incentive Rs. <#INCENTIVE_AMOUNT> has been credited to your bank account no. xxxxxxxx<#LAST_4_DIGITS_OF_ACCOUNT_NUMBER>.</p>\r\n\r\n<p>Thank you,</p>\r\n\r\n<p>Team Nyaya Portal</p>\r\n','<#USER_NAME>,<#STAMP_NUMBER>,<#INCENTIVE_AMOUNT>,<#LAST_4_DIGITS_OF_ACCOUNT_NUMBER>'),(8,'Nyaya Card created through online payment for deed writer','nc_online_payment_mail_to_deed_writer','',1,'<p>Dear <#USER_NAME></p>\r\n\r\n<p>Thank you for promoting Arbitration. Nyaya Card for stamp number <#STAMP_NUMBER> has been created successfully. The incentive Rs. <#INCENTIVE_AMOUNT> has been credited to your bank account no. xxxxxxxx<#LAST_4_DIGITS_OF_ACCOUNT_NUMBER></p>\r\n\r\n<p>Thank you,</p>\r\n\r\n<p>Team Nyaya Portal</p>\r\n','<#USER_NAME>,<#STAMP_NUMBER>,<#INCENTIVE_AMOUNT>,<#LAST_4_DIGITS_OF_ACCOUNT_NUMBER>'),(9,'Profile Completion','profile_completion','Profile completed successfully',1,'<p>Dear <#USER_NAME>,</p>\r\n\r\n<p>Congratulation!! You are successfully registered at Nyayaportal.in as <#PROFESSION_NAME>. Your ID is <#USER_ID>.</p>\r\n\r\n<p>Thank you,</p>\r\n\r\n<p>Team Nyaya Portal</p>\r\n','<#USER_NAME>,<#PROFESSION_NAME>,<#USER_ID>'),(10,'Renew Nyaya Card message to customers','renew_nyaya_card_msg_to_customers','',2,'Dear <#CUSTOMER_NAME>%0aYour Nyaya card number <#NC_NUMBER> is going to expire on <#NC_EXPIRY_DATE>. You are requested to contact your <#PROFESSION_NAME> <#PROFESSIONAL_NAME> <#PHONE_NUMBER> before <#NC_EXPIRY_DATE> for renewal.%0a%0aThank you,%0aTeam Nyaya Portal','<#CUSTOMER_NAME>,<#NC_NUMBER>,<#NC_EXPIRY_DATE>,<#PROFESSION_NAME>,<#PROFESSIONAL_NAME>,<#PHONE_NUMBER>'),(11,'Renew Nyaya Card message to professionals','renew_nyaya_card_msg_to_professional','',2,'Dear <#PROFESSIONAL_NAME>%0aNyaya Card Number <#NC_NUMBER> is going to expire on <#NC_EXPIRY_DATE>. You are requested to advice your client <#CLIENT_NAME> <#CLIENT_CONTACT_NUMBER> for renewal before <#NC_EXPIRY_DATE>.%0a%0aThank you,%0aTeam Nyaya Portal','<#PROFESSIONAL_NAME>,<#NC_NUMBER>,<#NC_EXPIRY_DATE>,<#CLIENT_NAME>,<#CLIENT_CONTACT_NUMBER>'),(12,'Nyaya Card renewed confirmation message to customers','nc_card_renewed_confirmation_message_to_customers','',2,'Dear <#CUSTOMER_NAME>,%0aYour Nyaya Card Number <#NC_NUMBER> has been renewed for the period <#START_DATE> to <#END_DATE>, after renewal, Nyaya card number is <#NC_NUMBER>.%0aThank you for trusting Nyaya portal.%0aTeam Nyaya Portal','<#CUSTOMER_NAME>,<#NC_NUMBER>,<#START_DATE>,<#END_DATE>'),(13,'Nyaya Card renewed confirmation with Incentive message to professional','nc_card_renewed_confirmation_with_incentive_message_to_professional','',2,'Dear <#PROFESSIONAL_NAME>,%0aNyaya Card Number <#NC_NUMBER> has been renewed for the period <#START_DATE> to <#END_DATE>, after renewal, Nyaya card number is <#NC_NUMBER>. Incentive amount Rs. <#INCENTIVE_AMOUNT> has been credited to your account number xxxxxxx<#LAST_4_DIGITS_OF_ACCOUNT_NUMBER>. Thank you for promoting arbitration.%0aTeam Nyaya Portal','<#PROFESSIONAL_NAME>,<#NC_NUMBER>,<#START_DATE>,<#END_DATE>,<#INCENTIVE_AMOUNT>,<#LAST_4_DIGITS_OF_ACCOUNT_NUMBER>'),(14,'Turn Over Based Deals','turn_over_based_deals','',2,'Dear <#PROFESSIONAL_NAME>%0aCongratulations! You have achieved the sales target of period <#START_DATE> to <#END_DATE>, your bank account no. xxxxxxxx<#LAST_4_DIGITS_OF_ACCOUNT_NUMBER> wil